            <Typography className={classes.step} component="label" variant="h5">
              Cadastro
            </Typography>
          </Grid>
          <Grid item xs={12}>
            <SignUpForm />
          </Grid>
        </Grid>
      </Grid>

      <Grid className={classes.gridApresentacao} item xs={false} sm={6}></Grid>
    </Grid>
  );
}
